class CaptchaModel {
  CaptchaModel({
      String? id, 
      String? src,}){
    _id = id;
    _src = src;
}

  CaptchaModel.fromJson(dynamic json) {
    _id = json['id'];
    _src = json['src'];
  }
  String? _id;
  String? _src;
CaptchaModel copyWith({  String? id,
  String? src,
}) => CaptchaModel(  id: id ?? _id,
  src: src ?? _src,
);
  String? get id => _id;
  String? get src => _src;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['src'] = _src;
    return map;
  }

}